import React, { Component } from 'react';
import PropTypes from 'prop-types';
import AlbumCard from './AlbumCard';

class Resultado extends Component {
  render() {
    const { termoBusca, albumList } = this.props;

    return (
      <>
        <h2>
          {albumList.length > 0
            ? `Resultado de 치lbuns de: ${termoBusca}` : 'Nenhum 치lbum foi encontrado' }
        </h2>
        <section>
          {albumList.map((album) => (
            <AlbumCard key={ album.collectionId } { ...album } />

          ))}

        </section>
      </>
    );
  }
}

Resultado.propTypes = {
  termoBusca: PropTypes.string,
  albumList: PropTypes.arrayOf(PropTypes.shape({
    collectionId: PropTypes.number,
    artistName: PropTypes.string,
    collectionName: PropTypes.string,
    artworkUrl100: PropTypes.string,
  })),
}.isRequired;

export default Resultado;
